import React, { useState, useEffect } from "react";
import { Card, CardBody, CardTitle, Badge, Button } from "reactstrap";
import { Link } from "react-router-dom";
import instance from "../../../helpers/axiosly";
import moment from "moment";

const RecentWithdrawal = (props) => {


  const [state, setState] = useState({
    withdrawalList: [],
    loading: false
  });

  useEffect(() => {
    setState({...state, loading: true})
    async function fetchData(){
    try {
      const token = localStorage.getItem("token")
      const res = await instance
        .get(`${process.env.REACT_APP_DATABASEURL}withdrawal`, {
          headers: {
            Authorization: `Bearer ${token}`,
          },
        })


        const lastList = res.data.data.rows.slice(0, 2)

          setState({
            ...state,
            withdrawalList: lastList,
            loading: false
          });

    } catch (e) {
      console.log(e);
    }
    }
    fetchData();

    //eslint-disable-line
  }, [])


  return (
    <React.Fragment>
      <Card>
        <CardBody>
          <CardTitle className="mb-4">RECENT WITHDRAWAL REQUEST</CardTitle>
          {state.loading ? (<div class="spinner-border" role="status">
                  <span class="sr-only">Loading...</span>
                  </div>):
          (
            <div>
              <Link
            className="btn btn-primary waves-effect waves-light mb-2"
            to="/withdrawal"
          >
            View Withdrawal
          </Link>
          <div className="table-responsive">
            <table className="table table-centered table-nowrap mb-0">
              <thead className="thead-light">
                <tr>
                <th>#</th>
                  <th></th>
                  <th></th>
                </tr>
              </thead>
              <tbody>
                {/*state.withdrawalList.map((client, key) => (
                  <tr key={"_tr_" + key}>
                    <td>
                      <div className="custom-control custom-checkbox">
                        <input
                          type="checkbox"
                          className="custom-control-input"
                          id={client.id}
                        />
                        <label
                          className="custom-control-label"
                          htmlFor={client.id}
                        >
                          &nbsp;
                        </label>
                      </div>
                    </td>
                    <td>
                      <Link to="#" className="text-body font-weight-bold">
                        {" "}
                        {client.id}{" "}
                      </Link>{" "}
                    </td>
                    <td>{client.first_name} {client.first_name}</td>
                    <td>{client.email}</td>
                    <td>{moment(client.createdAt).format("MMMM Do YYYY")}</td>
                  </tr>
                ))*/}
              </tbody>
            </table>
          </div>
            </div>
          )}
        </CardBody>
      </Card>
    </React.Fragment>
  );
};

export default RecentWithdrawal;
